import {
    BrowserRouter,
    Routes,
    Route
} from "react-router-dom";
import Navbar from "../components/navbar";
import Title from "../components/title";

const Router = () => {


    return (
        <BrowserRouter>
            <Navbar/>
            <Routes>
                <Route path="/" element={ <Title/> } />
                <Route path="/option_1" element={<Title/>} />
            </Routes>
        </BrowserRouter>
    )
}

export default Router
